import React from "react";


const UserItem = () =>  {
    const {id, login , avatar_url , html_url} = this.props.user;  // this var will help to remove extra this.state code from component
    return (
      <div className="card text-center">
        <img
          src={avatar_url}
          alt=""
          className="round-img"
          style={{ width: "60px" }}
        />
        <h3>{login}</h3>
        <div>
          <a href={html_url} className="btn btn-dark btn-sm my-1">
            More
          </a>
        </div>
      </div>
    );
  }

export default UserItem;
